import React from 'react';
import SkillBar from './SkillBar';
const Skills = () => {

// Skills.js

const skills = [
  {name: 'HTML', level: 90},
  {name: 'CSS', level: 80}, 
  {name: 'JavaScript', level: 70},
  {name: 'React', level: 60},
  {name: 'Django', level: 80},
  {name: 'jQuery', level: 60},
  {name: 'Bootstrap', level: 50},
  {name: 'Tailwind CSS', level: 30},

];

return (
  <div className="skills-container">
    <h1>Skills</h1>
    <div className='hard-skills'>
    {skills.map(skill => ( 
      <SkillBar 
        key={skill.name}
        name={skill.name}
        level={skill.level} 
      />
    ))}
</div>
   <div className="language-skills">   
      <h2>Languages</h2> 
      {skills  
        .filter(skill => skill.lang)      
        .map(skill => (    
          <SkillBar       
            key={skill.name}      
            name={skill.name}    
            level={skill.level}      
          />     
        ))}         
    </div>
  </div>
);
}

export default Skills;
